import{_ as o,c as e,o as t,V as a}from"./chunks/framework.OTU5OxHT.js";const k=JSON.parse('{"title":"常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"daxpay/guides/other/常见问题.md","filePath":"daxpay/guides/other/常见问题.md","lastUpdated":1709652276000}'),c={name:"daxpay/guides/other/常见问题.md"},l=a('<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题">¶</a></h1><blockquote><ol><li>在调用需要证书的接口事，出现 javax.net.ssl.SSLHandshakeException: No appropriate protocol (protocol is disabled or cipher suites are inappropriate)错误</li></ol></blockquote><p>原因：ssl 握手失败，使用了java.security不支持的版本，换一下最新的JDK即可, 例如 corretto Jdk</p><blockquote><ol start="2"><li>支付订单有效期是多久，如何进行设置？</li></ol></blockquote><p>支付订单有效期默认是30分钟，如果超过30分钟，支付订单会自动失效。可以在管理后台设置默认的支付订单有效期。也可以通过调用接口设置支付订单有效期，接口如果传输了过期时间，优先使用接口传入的过期时间。</p><blockquote><ol start="3"><li>调用微信、支付宝的等接口时，使用的是什么类型签名方式？</li></ol></blockquote><p>对调用各种第三方支付网关接口的签名方式，只要是支持<code>HMAC-SHA256</code>方式，都是使用<code>HMAC-SHA256</code>方式，签名过程都由支付网关进行了处理，不需要业务系统对这块进行额外处理。</p><blockquote><ol start="4"><li>出现订单超时不会自动关闭、不会重新发送业务通知等异常情况，该如何处理</li></ol></blockquote><p>通常是系统中没有开启对应的定时任务，可以进入到 <code>系统管理</code>-&gt; <code>系统配置</code> -&gt; <code>定时任务</code> 中，将对应的定时任务开启即可。</p>',9),r=[l];function s(d,i,p,_,n,u){return t(),e("div",null,r)}const b=o(c,[["render",s]]);export{k as __pageData,b as default};
